import React from 'react'
import { connect } from 'react-redux'
import { toggleFilter } from '../actions'

const ToggleFilter = ({dispatch}) =>{

    return(
        <div className="row">
        <div className={classnames('col-md-6 text-center task-filter')} onClick={() => dispatch(toggleFilter(true))}>Incomplete Tasks</div>
        <div className={classnames('col-md-6 text-center task-filter')} onClick={() => dispatch(toggleFilter(false))}>Completed Tasks </div>
      </div>
    )
}

export default connect()(ToggleFilter)
